import React from 'react';
import { View, Image } from 'react-native';
import StyleCentre from './StyleCenter';

const Center =()=>{
    return <View>
        <Image style = {StyleCentre.imgStyle} source={{ uri:"https://www.biletik.aero/upload/medialibrary/807/807f262b60da392f1e09aa6d33f20a9b.png" }}></Image>
    </View>
}

export default Center;
